	uploadVideoOrImage: async () => {
		//use async-await or promises
		if(FilePicker3.files[0].type == "video/mp4"){
			uploadVideo.run(()=> getSingleAd.run(), () => showAlert('Try to upload media with smaller size', 'warning'))
			return true
		}
		if(FilePicker3.files[0].type =="image/png" || FilePicker3.files[0].type =="image/jpeg" ){
			uploadFile.run(()=> getSingleAd.run(), () => showAlert('Try to upload media with smaller size', 'warning'))
			return true
		}
		else{
			showAlert('select wrong file type','error')
			return true
		}
	},
	media: () => {
		let ids = getSingleAd.data.creative.map(e => e.media_type_id).filter(e => e != null)
		let newId = []

		for( let id of ids ){
		let one =	getMediaTypes.data.find(e => e.id === id).name
		newId.push(one)
		}

		return newId.toString()
	}
}

