filltering: async () => {
    let obj = appsmith.store.filter;
    //let arr = appsmith.store.MapData;
    let arrCopy = appsmith.store.MapData;
	if (MapWithClusterMarker3.getBounds) {
        arrCopy = arrCopy.filter(el => el.lon > MapWithClusterMarker3.getBounds.west && el.lon < MapWithClusterMarker3.getBounds.east && el.lat > MapWithClusterMarker3.getBounds.south && el.lat < MapWithClusterMarker3.getBounds.north)
    }

	for (var key in obj) {
        if (typeof obj[key] == "string") {
            arrCopy = arrCopy.filter(el => el[key] == obj[key])
        }
        if (typeof obj[key] == "object" && obj[key].length > 0) {
            let obj1 = obj[key];
            var arr2 = [];
            for (var i = 0; i < arrCopy.length; i++) {
                let filtering = obj1.filter(el => el == arrCopy[i][key])
                if (filtering && filtering.length > 0) {
                    arr2.push(arrCopy[i])
                }
            }
            arrCopy = arr2;
        }
    }

    console.log(arrCopy)
    storeValue("ShowData", arrCopy)
    return arrCopy
},
		RunMainQuery2:  () => {
		mapQuery.run();
		return mapQuery.data
	},	
}

